// src/admin/AdminHome.js
import React from 'react';
import { Link } from 'react-router-dom';
import './AdminHome.css';
import profileImage from '../photos/profile.jpg'; // Ensure this path matches your file location
import backgroundImage from '../photos/background.jpg'; // Ensure this path matches your file location
import productImages from '../photos'; // Placeholder images for products

const productNames = [
  "Product 1", "Product 2", "Product 3", "Product 4",
  "Product 5", "Product 6", "Product 7", "Product 8",
  "Product 9", "Product 10", "Product 11", "Product 12",
  "Product 13", "Product 14", "Product 15", "Product 16",
  "Product 17", "Product 18", "Product 19", "Product 20"
];

const AdminHome = () => {
  return (
    <div className="admin-home">
      <header className="admin-header">
        <div className="header-left">B.Planet</div>
        <div className="header-right">
          <a href="/contact" className="header-link">Contact Us</a>
          <a href="/" className="header-link">Login</a>
          <img src={profileImage} alt="Profile" className="profile-image" onClick={() => window.location.href = '/profile'} />
        </div>
      </header>
      <div className="admin-content">
        <div className="bottom-section">
          <div className="products">
            <h2>Products</h2>
            <div className="product-grid">
              {productNames.map((name, index) => (
                <div className="product-item" key={index}>
                  <Link to={`/admin/product/${index + 1}`}>
                    <img src={productImages[`product${index + 1}.jpg`]} alt={name} />
                    <span>{name}</span>
                  </Link>
                </div>
              ))}
            </div>
            <div className="pagination">
              <button>&laquo; Prev</button>
              <button>Next &raquo;</button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminHome;
